	add("cloud", "{\"term\":\"cloud\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"Danish\", \"German\", \"English\", \"middle english (1100-1500)\", \"Icelandic\", \"Dutch\", \"scots\", \"Swedish\"], \"text\":\"From Middle english (1100-1500) \u0027cloud\u0027 \u0027cloude\u0027 \u0027clod\u0027 \u0027clud\u0027 \u0027clude\u0027 from Old english (ca. 450-1100) {{m|ang|clūd||mass of stone, rock, boulder, hill}}, from Proto-germanic {{m|gem-pro|*klūtaz}}, {{m|gem-pro|*klutaz||lump, mass, conglomeration}}, from Proto-indo-european {{m|ine-pro|*gel-||to ball up, clench}}. Cognate with Scots \u0027cloud\u0027 \u0027clud\u0027 (cloud) Dutch \u0027kluit\u0027 (lump, mass, clod) German low german \u0027kluute\u0027 German \u0027kloß\u0027 (lump, dumpling, meatball) Danish \u0027klode\u0027 (sphere, orb, planet) Swedish \u0027klot\u0027 (sphere, orb, ball, globe) Icelandic \u0027klót\u0027 (knob on a sword\u0027s hilt) Related to {{l|en|clod}}, {{l|en|clot}}, {{l|en|clump}}, {{l|en|club}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A rock; boulder; a hill\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A visible mass of water droplets suspended in the air\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"So this was my future home, I thought!Backed by towering hills, the but faintly discernible purple line of the French boundary off to the southwest, a sky of palest Gobelin flecked with fat, fleecy little \u0027\u0027clouds\u0027\u0027, it in truth looked a dear little city; the city of one\u0027s dreams\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Any mass of dust, steam or smoke resembling such a mass\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/asia/21580154-forest-fires-bring-record-levels-air-pollution-and-end-not-sight-unspontaneous Unspontaneous passage\u003dSince the mid-1980s, when Indonesia first began to clear its bountiful forests on an industrial scale in favour of lucrative palm-oil plantations, “haze” has become an almost annual occurrence in South-East Asia. The cheapest way to clear logged woodland is to burn it, producing an acrid \u0027\u0027cloud\u0027\u0027 of foul white smoke that, carried by the wind, can cover hundreds, or even thousands, of square miles\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Anything which makes things foggy or gloomy\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A group or swarm, especially suspended above the ground or flying\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"so great a \u0027\u0027cloud\u0027\u0027 of witnesse\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"An elliptical shape or symbol whose outline is a series of semicircles, supposed to resemble a cloud\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The Internet, regarded as an amorphous omnipresent space for processing and storage, the focus of cloud computing\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"issue\u003d1|page\u003d18|magazine\u003d|title\u003d[http://www.guardian.co.uk/commentisfree/2013/jun/07/obama-apple-google-facebook-tainted-prism Obama\u0027s once hip brand is now passage\u003dNow we are liberal with our innermost secrets, spraying them into the public ether with a generosity our forebears could not have imagined. Where we once sent love letters in a sealed envelope, or stuck photographs of our children in a family album, now such private material is despatched to servers and \u0027\u0027clouds\u0027\u0027 operated by people we don\u0027t know and will never meet\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A negative aspect of something positive: see every cloud has a silver lining or every silver lining has a cloud\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Crystal methamphetamine\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A large, loosely-knitted headscarf worn by women\", \"priority\":14}]}, \"synonyms\":{}}");

	add("clout", "{\"term\":\"clout\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\"], \"text\":\"Old english (ca. 450-1100) {{m|ang|clūt}}, from Proto-germanic {{m|gem-pro|*klūtaz}}, from Proto-indo-european {{m|ine-pro|*glūdos}}. Cognate with Old Norse \u0027klútr\u0027 (kerchief) lt;ref\u0026gt;{{R:Webster 1913|clout}}\u0026lt;/ref\u0026gt; (Swedish \u0027klut\u0027 Danish \u0027klud\u0027 , Middle High German {{m|gmh|klōz||lump}} (German \u0027kloß\u0027 , dialect Russian \u0027глуда\u0027 lt;ref\u0026gt;[http://www.merriam-webster.com/dictionary/clout clout] in Merriam-Webster\u0027s Dictionary\u0026lt;/ref\u0026gt;. See also clea. etymology|cleat. The sense \u0026quot;influence, especially political\u0026quot; originated in the dialect of w:Chicago|Chicago, but has become widespread.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Influence or effectiveness, especially political\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A blow with the hand\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1910\u0027\u0027, w:Katherine Katherine Mansfield, \u0027Frau Brenchenmacher Attends A Wedding\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Such a \u0027\u0027clout\u0027\u0027 on the ear as you gave me… But I soon taught you\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A home run\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, w:Michael Michael Vega, \u0026quot;Triple double\u0026quot;, in \u0027The Boston Globe\u0027, August 17, 2011, p. C1\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"allowed Boston to score all of its runs on homers, including a pair of \u0027\u0027clouts\u0027\u0027 by Jacoby Ellsbury\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The center of the butt at which archers shoot; probably once a piece of white cloth or a nail head\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A\u0027 must shoot nearer or he\u0027ll ne\u0027er hit the \u0027\u0027clout\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A swaddling cloth\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A cloth; a piece of cloth or leather; a patch; a rag\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Spense\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"His garments, nought but many ragged \u0027\u0027clouts\u0027\u0027, / With thorns together pinned and patched was\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"a \u0027\u0027clout\u0027\u0027 upon that head where late the diadem stoo\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"title\u003dSeafarers: The page\u003d33|passage\u003dThe Byzantines, wrote , hooted and jeered from the battlements, \u0026quot;and let down their \u0027\u0027clouts\u0027\u0027 and showed them their backsides.\u0026quot\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"An iron plate on an axletree or other wood to keep it from wearing; a washer\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"1866\u0027\u0027, w:James Edwin Thorold James Edwin Thorold Rogers, \u0027A History of Agriculture and Prices in England\u0027, Volume 1, p. 546\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"Clouts\u0027\u0027 were thin and flat pieces of iron, used it appears to strengthen the box of the wheel; perhaps also for nailing on such other parts of the cart as were particularly exposed to wear\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"A piece; a fragment\", \"priority\":21}]}, \"synonyms\":{}}");

	add("cloudburst", "{\"term\":\"cloudburst\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|cloud|burst|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sudden heavy rainstorm\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1899\u0027\u0027, w:Edith Edith Wharton, \u0026quot;A Cup of Cold Water\u0026quot; in \u0027The Greater Inclination\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"B]ut the sound . . . expressed an utter abandonment to grief; not the \u0027\u0027cloud-burst\u0027\u0027 of some passing emotion, but the slow down-pour of a whole heaven of sorrow\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1908\u0027\u0027, w:Stewart Edward Stewart Edward White, \u0027The Riverman\u0027, ch. 38\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027cloudburst\u0027\u0027 in the China Creek district followed by continued heavy rains was responsible for the increased water\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1936\u0027\u0027 Aug. 17, \u0026quot;[http://content.time.com/time/magazine/article/0,9171,756493,00.html Miscellany],\u0026quot; \u0027Time\u0027 \u0026lt;small\u0026gt;(retrieved 20 May 2014)\u0026lt;/small\u0026gt\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"In Uniontown, Pa., John Walchesky \u0026amp; family rushed from their house when lightning set it afire, rushed in again when a \u0027\u0027cloudburst\u0027\u0027 put out the blaze\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027 Feb. 25, w:Norman Norman Howard, \u0026quot;[http://www.nytimes.com/2007/02/25/books/chapters/0225-1st-norm.html?pagewanted\u003dprint\u0026amp;_r\u003d0 \u0027Devotion\u0027, chapter 1]\u0026quot; (book excerpt), \u0027New York Times\u0027 \u0026lt;small\u0026gt;(retrieved 20 May 2014)\u0026lt;/small\u0026gt\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"H]e walked across the lawn, wet from a fleeting late-afternoon \u0027\u0027cloudburst\u0027\u0027, the first rain in a month\", \"priority\":9}]}, \"synonyms\":{}}");

	add("cloudbust", "{\"term\":\"cloudbust\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|cloud|bust|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A cloudburst\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1929\u0027\u0027, \u0027Boys\u0027 Life\u0027 (June 1929, page 72\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A sudden \u0027\u0027cloudbust\u0027\u0027 up in the hills during the night swelled the cree\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1949\u0027\u0027, George Palmer Putnam, \u0027Hickory shirt: a novel of Death Valley in 1850\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"quot;Setting up for a \u0027\u0027cloudbust\u0027\u0027,\u0026quot; Hickory said. \u0026quot;She don\u0027t aim to hit right around here, anyway.\u0026quot\", \"priority\":5}]}, \"synonyms\":{}}");

	add("cloudbuster", "{\"term\":\"cloudbuster\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|cloud|buster|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A pseudoscientific device supposed to drain clouds of orgone and thus cause rain\", \"priority\":1}]}, \"synonyms\":{}}");

	add("cloudiness", "{\"term\":\"cloudiness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|cloudy|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being cloudy (e.g. weather\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Expect considerable \u0027\u0027cloudiness\u0027\u0027 with occasional rain showers\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The property of being murky (e.g. liquid, style\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Cloudiness\u0027\u0027 in the water is most often caused in new aquariums by white bacteria\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The property of being obscure (e.g. information\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Don\u0027t add \u0027\u0027cloudiness\u0027\u0027 to your writing\", \"priority\":6}]}, \"synonyms\":{}}");

	add("cloudland", "{\"term\":\"cloudland\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|cloud|land|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"fantasy land, dreamlan\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Wide awake, all at once, he was at the same time plunged even deeper into a \u0027\u0027cloudland\u0027\u0027 of symbols to which he had no key\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Matilda Betham-Edwards, \u0027In the Heart of the Vosges\u0027, BiblioBazaar, LLC, page 102 [http://books.google.com/books?id\u003dp89fcP8LQmYC\u0026amp;pg\u003dPA102\u0026amp;dq\u003dcloudland+date:1950-2008\u0026amp;lr\u003dlang_en\u0026amp;as_brr\u003d3\u0026amp;sig\u003duHn7xp6q_KORqSUJTlxsuBpj8V0\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Nothing can be more like a ride in \u0027\u0027cloudland\u0027\u0027 than the drive from Pierrefitte to Luz and from Luz to Gavarnie\", \"priority\":4}]}, \"synonyms\":{}}");

