	add("clover", "{\"term\":\"clover\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"Old Church Slavonic\", \"German\", \"English\", \"middle english (1100-1500)\", \"ancient greek (to 1453)\", \"low german\", \"Dutch\", \"plautdietsch\", \"saterfriesisch\"], \"text\":\"From Middle english (1100-1500) \u0027clovere\u0027 \u0027claver\u0027 from Old english (ca. 450-1100) \u0027clāfre\u0027 earlier \u0027clǣfre\u0027 from Proto-germanic {{m|gem-pro|*klaibrǭ}} (compare Saterfriesisch \u0027kleeuwer\u0027 Dutch \u0027klaver\u0027 dialectal Low german \u0027kleeber\u0027 \u0027kleewer\u0027 , enlargement of *\u0027\u0027 (klaiwaz) (compare Plautdietsch \u0027kjlee\u0027 German \u0027klee\u0027 , from Proto-indo-european {{m|ine-pro|*glei-||to stick}} (compare Old church slavonic \u0027глѣвъ\u0027 (slime) Ancient greek (to 1453) \u0027γλοιός\u0027 (lang\u003dgrc) . More at {{l/en|cleave}}, {{l/en|clay}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A plant of the genus \u0027Trifolium\u0027 with leaves usually divided into three (rarely four) leaflets and with white or red flowers\", \"priority\":1}]}, \"synonyms\":{}}");

	add("clown", "{\"term\":\"clown\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Icelandic\", \"old frisian\"], \"text\":\"Likely from akin to Icelandic \u0027klunni\u0027 (klutz) and Old frisian \u0027klönne\u0027 (klutz)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"thumb|\u0027\u0027clown\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A performance artist often associated with a circus and typically characterised by bright, oversized clothing, a red nose, face paint, and a brightly colored wig and who performs slapstick\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A person who acts in a silly fashion\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A stupid person\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A man of coarse nature and manners; an awkward fellow; an illbred person; a boor\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"One who works upon the soil; a rustic; a churl\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Cowpe\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027clown\u0027\u0027, the child of nature, without guile\", \"priority\":8}]}, \"synonyms\":{}}");

	add("clownery", "{\"term\":\"clownery\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|clown|ery|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The behaviour of a clown; clownishness, tomfoolery\", \"priority\":1}]}, \"synonyms\":{}}");

	add("clownfish", "{\"term\":\"clownfish\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of colorful fish of the genera \u0027Amphiprion\u0027 and \u0027Premnas\u0027 in the subfamily Amphiprioninae, native to the Pacific and Indian Oceans, notable for their mutual relationship with sea anemones\", \"priority\":1}]}, \"synonyms\":{}}");

	add("clownophobia", "{\"term\":\"clownophobia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{affix|en|clown|-o-|-phobia}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The fear of clowns\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, \u0027Transit Lounge: An Interface Book from 21.C\u0027 (eds. Ashley Crawford \u0026amp; Ray Edgar), North Ryde (1997), ISBN 9789057041112, [http://books.google.com/books?id\u003d-x5UAAAAMAAJ\u0026amp;q\u003d%22roots+of+clownophobia%22\u0026amp;redir_esc\u003dy page 174\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A facile, pop-psych explanation would unearth the roots of \u0027\u0027clownophobia\u0027\u0027 in childhood traumas\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Richard Crouse, \u0027The 100 Best Movies You\u0027ve Never Seen\u0027, ECW Press (2003), ISBN 1550225901, [http://books.google.com/books?id\u003dyoXc027lgxsC\u0026amp;pg\u003dPA130\u0026amp;dq\u003d%22clownophobia%22 page 130\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"While most of us see Ronald McDonald as a nice corporate symbol, the 8% of the population that suffers from \u0027\u0027clownophobia\u0027\u0027 (more properly called coulrophobia) view him as evil incarnate\", \"priority\":5}]}, \"synonyms\":{}}");

